import React from "react";
import { useNavigate } from "react-router-dom";

const Manager = () => {
  const navigate = useNavigate();

  const goTo = (path) => {
    navigate(path);
  };

  return (
    <div className="min-h-screen bg-gray-100 py-10 px-6 flex flex-col items-center">
      <h2 className="text-3xl font-bold text-blue-700 mb-8">üë©‚Äçüíº Manager Dashboard</h2>

      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6 w-full max-w-4xl">
        <button
          onClick={() => goTo("/drink-menu")}
          className="bg-white shadow-md p-4 rounded-lg text-blue-600 font-semibold hover:bg-blue-100"
        >
          Drink Menu
        </button>
        <button
          onClick={() => goTo("/inventory")}
          className="bg-white shadow-md p-4 rounded-lg text-blue-600 font-semibold hover:bg-blue-100"
        >
          Inventory
        </button>
        <button
          onClick={() => goTo("/trends")}
          className="bg-white shadow-md p-4 rounded-lg text-blue-600 font-semibold hover:bg-blue-100"
        >
          Trends
        </button>
        <button
          onClick={() => goTo("/employee")}
          className="bg-white shadow-md p-4 rounded-lg text-blue-600 font-semibold hover:bg-blue-100"
        >
          Employee
        </button>
        <button
          onClick={() => goTo("/menu")}
          className="bg-white shadow-md p-4 rounded-lg text-blue-600 font-semibold hover:bg-blue-100"
        >
          Orders
        </button>
        <button
          onClick={() => goTo("/add-seasonal")}
          className="bg-white shadow-md p-4 rounded-lg text-blue-600 font-semibold hover:bg-blue-100"
        >
          Add Seasonal Menu Item
        </button>
        <button
          onClick={() => goTo("/product-usage")}
          className="bg-white shadow-md p-4 rounded-lg text-blue-600 font-semibold hover:bg-blue-100"
        >
          Product Usage
        </button>
        <button
          onClick={() => goTo("/x-report")}
          className="bg-white shadow-md p-4 rounded-lg text-blue-600 font-semibold hover:bg-blue-100"
        >
          X-Report
        </button>
        <button
          onClick={() => goTo("/z-report")}
          className="bg-white shadow-md p-4 rounded-lg text-blue-600 font-semibold hover:bg-blue-100"
        >
          Z-Report
        </button>
        {/* ‚úÖ Order History ÊåâÈíÆ */}
        <button
          onClick={() => goTo("/order-history")}
          className="bg-white shadow-md p-4 rounded-lg text-blue-600 font-semibold hover:bg-blue-100"
        >
          Order History
        </button>

        <button
          onClick={() => goTo("/")}
          className="bg-red-500 text-white p-4 rounded-lg font-semibold hover:bg-red-600 shadow-md"
        >
          Logout
        </button>
      </div>
    </div>
  );
};

export default Manager;
